import React from 'react';
import './sidenav.css';
import dashboardicon from './cityscape.png';

const SideNav = () => {
	return (
		<nav className="sidebar">
			<p> Sign In </p>
			<img src={ dashboardicon } class="navicon" alt="Dashboard" />
			<p>Dashboard</p>
		</nav>
	);
}

export default SideNav;
